import React from 'react';
import Integrated_Approach from '../component/Integrated_Approach';
import Basic_skills from '../component/Basic_skills';
import Subscripe from '../component/Subscripe';
import Partitions from '../component/Partitions';
import Features from '../component/Features';
import Sotoor_Partitions from '../component/Sotoor_Partitions';
const Home = () => {
    return ( 
        <>
        <Integrated_Approach />
        <Basic_skills />
        <Subscripe />
        <Partitions />
        <Features />
        <Sotoor_Partitions />
        </>
     );
}

export default Home;
